import pygame
import sys

# Initialize Pygame
pygame.init()

# Constants
WIDTH, HEIGHT = 800, 600
FPS = 60
PLAYER_SIZE = 40
TILE_SIZE = 64
WORLD_WIDTH = 50
WORLD_HEIGHT = 50

# Colors
WHITE = (255, 255, 255)
GREEN = (50, 200, 50)
BLUE = (50, 50, 255)

# Setup display
screen = pygame.display.set_mode((WIDTH, HEIGHT))
pygame.display.set_caption("Large-Scale Game Prototype")
clock = pygame.time.Clock()

# Load player sprite (for now just a rectangle)
player_img = pygame.Surface((PLAYER_SIZE, PLAYER_SIZE))
player_img.fill(BLUE)

# Player object
player = pygame.Rect(WIDTH // 2, HEIGHT // 2, PLAYER_SIZE, PLAYER_SIZE)
speed = 5

# Simple tile map (can be replaced with dynamic generation later)
world = [[0 for _ in range(WORLD_WIDTH)] for _ in range(WORLD_HEIGHT)]

# Camera offset
camera_x, camera_y = 0, 0

# Main loop
def main():
    global camera_x, camera_y
    running = True

    while running:
        dt = clock.tick(FPS)
        for event in pygame.event.get():
            if event.type == pygame.QUIT:
                running = False

        # Player movement
        keys = pygame.key.get_pressed()
        dx, dy = 0, 0
        if keys[pygame.K_a]: dx = -speed
        if keys[pygame.K_d]: dx = speed
        if keys[pygame.K_w]: dy = -speed
        if keys[pygame.K_s]: dy = speed

        player.x += dx
        player.y += dy

        # Update camera to follow player
        camera_x = player.x - WIDTH // 2 + PLAYER_SIZE // 2
        camera_y = player.y - HEIGHT // 2 + PLAYER_SIZE // 2

        # Draw world
        screen.fill(WHITE)
        for y in range(WORLD_HEIGHT):
            for x in range(WORLD_WIDTH):
                tile_rect = pygame.Rect(
                    x * TILE_SIZE - camera_x,
                    y * TILE_SIZE - camera_y,
                    TILE_SIZE,
                    TILE_SIZE,
                )
                pygame.draw.rect(screen, GREEN, tile_rect, 1)

        # Draw player
        screen.blit(player_img, (player.x - camera_x, player.y - camera_y))

        pygame.display.flip()

    pygame.quit()
    sys.exit()

if __name__ == "__main__":
    main()
class NPC:
    def __init__(self, name, x, y):
        self.name = name
        self.rect = pygame.Rect(x, y, 40, 40)

    def draw(self, screen, camera_x, camera_y):
        pygame.draw.rect(screen, (255, 0, 0), 
                         (self.rect.x - camera_x, self.rect.y - camera_y, self.rect.width, self.rect.height))

    def interact(self):
        print(f"Talking to {self.name}...")

npc = NPC("Bob", 500, 500)

# In the main loop:
npc.draw(screen, camera_x, camera_y)

# Check for player proximity
if player.colliderect(npc.rect):
    npc.interact()
class Enemy:
    def __init__(self, x, y, health=100):
        self.rect = pygame.Rect(x, y, 40, 40)
        self.health = health

    def draw(self, screen, camera_x, camera_y):
        pygame.draw.rect(screen, (255, 0, 0), 
                         (self.rect.x - camera_x, self.rect.y - camera_y, self.rect.width, self.rect.height))

    def take_damage(self, damage):
        self.health -= damage
        if self.health <= 0:
            print("Enemy defeated!")

enemy = Enemy(700, 500)

# In the main loop:
enemy.draw(screen, camera_x, camera_y)

# Damage the enemy when player collides or attacks
if player.colliderect(enemy.rect):
    enemy.take_damage(10)
class Item:
    def __init__(self, name, x, y):
        self.name = name
        self.rect = pygame.Rect(x, y, 20, 20)

    def draw(self, screen, camera_x, camera_y):
        pygame.draw.rect(screen, (0, 255, 0), 
                         (self.rect.x - camera_x, self.rect.y - camera_y, self.rect.width, self.rect.height))

items = [Item("Health Potion", 600, 300), Item("Sword", 700, 300)]

# In the main loop:
for item in items:
    item.draw(screen, camera_x, camera_y)
    if player.colliderect(item.rect):
        print(f"Picked up {item.name}!")
        items.remove(item)  # Add item to inventory

